(14, 'Nefti', 'Nefti@poczta.fm', '5ae00f0ea6953e4fb7db46523c231cdc9ef06feab8fd39b9518a3c4f99a05be4', '<p>Nefti (dj, producer) was already interested in dance music before 1997, and made his debut behind the decks in 2001 Radio Lodz''s 99,2mHz "Nocny Trans" show. On the Lodz / Polish scene he plays energetic old school, hardcore breaks as well as happy hardcore, breakbeat and drum''n''bass. <br /><br />During this time he was involved in many events organized in and around Lodz, including "Parade of Freedom" in 2001 and 2002, "Innovation In The Lodz 2010" and many more.</p>', '2011-05-17 12:53:59', 'nefti', 1, 70, 0, 0, NULL, 1),
