(36, 'NICKY ALLEN', 'nicky.allen@live.co.uk', 'd83633765e9c69f7cba9461b8eacfe24f2ea39665fa4e8160edbfdc756c85338', '<p>Dj Nicky Allen, One of the finest Dj''s of any Genre to come out of Carlisle, Specialising in Oldskool Nicky started clubbing in his teens and was a regular at Carlisle''s Annabelles where he was bitten by the bug for Djing, If you needed to find Nicky in the 90''s all you''d need to go was Pink Panther Records and that explains him Boasting a record collection of over 10,000 LP''s, A vinyl Only Dj Nicky has since embraced the digital age by uploading mixes online, he boasts over 260 mixes of all ', '2011-05-26 07:50:49', 'nicky-allen', 1, 0, 0, 0, NULL, 1),
