INSERT INTO `texts` (`texts_id`, `texts_name`, `texts_value`, `texts_help`) VALUES
(1, 'Home-niezalogowany-welcome-text', '<p><span style="font-size: x-large;"><strong><span style="color: #04bae1;">SmashinTracks.com</span> is the best place</strong><strong>&nbsp; </strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: x-large;"><strong>where you may buy and sell your own </strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: x-large;"><strong>music, exclusive remixes and </strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: x-large;"><strong>up</strong> <strong>to date unreleased tracks.</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: medium;">Buying process runs with few clicks, payments are integrated</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: medium;">with <strong><a href="https://www.paypal.com/" target="_blank">Paypal</a></strong> system. All tracks available on <strong>SmashinTracks.com</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: medium;"> service are <strong><span style="color: #04bae1;">320 kbps</span></strong></span> <span style="font-size: medium;">only.</span></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span style="font-size: medium;">You only have to register in order to sell your tracks!</span></strong></p>\r\n<p><span style="font-size: medium;"><br /></span></p>\r\n<p><span style="font-size: large;"><strong>Step 1: REGISTER</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: large;"><strong>Step 2: UPLOAD</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: large;"><strong><span style="font-size: large;"><strong>Step 3: SELL</strong></span></strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: large;"><span style="font-size: medium;">Check our Recommends tracks, Charts, Artist and more.</span><strong><br /></strong></span></p>', ''),
(2, 'Home-niezalogowany-recommends-10-smashin-trac', '<p>Here''s a hand picked selection of <span class="blue">smashing tracks</span> personally recommended by <a class="underline" href="#">Smashintracks.com</a> in this week.</p>', ''),
(3, 'Home-niezalogowany-new-tracks', '<p>Here are the latest <span class="blue">10 tunes</span> on <a href="#" class="underline">Smashintracks.com</a><br />\r\n                        Click the button ''FULL LIST'' if you want see list of new tracks from latest months.</p>', ''),
(4, 'Home-niezalogowany-bestsellers-tracks', '<p>Here are <span class="blue">10 most popular tracks</span> on <a href="#" class="underline">Smashintracks.com</a> from latest week.<br />\r\n                        Click the button ''FULL LIST'' if you want see lists of new more charts.</p>', ''),
(5, 'Charts-This-Week-main-text', '<p>Here are the list with <span class="blue">30 bestsellers in this week </span>on <a class="underline" href="#">Smashintracks.com</a><br /> See also other ''CHARTS''.</p>', ''),
(6, 'FAQ-main-text', '<p>Answers for all pervaded questions regarding <a class="underline" href="#">Smashintracks.com</a> operation.</p>', ''),
(7, 'Genre-list-main-text', '                        Here are the latest <span class="blue">__GENRESNAME__ </span> tracks that have been uploaded through producers on <a href="#" class="underline">Smashintracks.com</a> Check this out!', '__GENRESNAME__ - nazwa gatunku'),
(8, 'New-tracks-main-text', '<p>Here are the latest <span class="blue">tunes</span> on <a href="#" class="underline">Smashintracks.com</a> that have been uploaded <br />\r\n                        through producers FROM all genres. Check this out!</p>', ''),
(9, 'Terms-main-text', '<p><strong>To use <a class="underline" href="#">Smashintracks.com</a> you must agree to the following terms and conditions:</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Artist must upload their only copyright material for which they do have permission to use and distribute.</p>\r\n<p>&nbsp;</p>\r\n<p>If an artist uploads any copyright protected material they will be banned and the profile will be removed from Smashitracks.com, uploaded therefore material will be definitely removed from the Smashintracks.com service.</p>', ''),
(10, 'Search-main-text', '<p>Here''s a hand picked selection of smashing tracks personally recommended by <a href="#" class="underline">Smashintracks.com</a> in this week.</p>', '__KEYWORD__ - szukane słowo'),
(11, 'Search-No-Results', '<p>Sorry, we couldn''t find any tracks matching <strong>__KEYWORD__</strong></p>\r\n<p>Try again please.<strong><br /></strong></p>', '__KEYWORD__ - szukane słowo'),
(12, 'Artists-30-most-popular-main-text', '<p>There is full listing of <span class="blue">30 top artists </span>on <a class="underline" href="#">Smashintracks.com</a>. Check this out!</p>', ''),
(13, 'Koszyk-main-text', '<p>You will receive <span class="blue">unique download links to your purchases</span> after you make payments. You may download <span class="blue">max 3 times</span> each track. Links will work for <span class="blue">7 days</span> after payment.</p>\r\n<p><span class="blue"><br /></span></p>', ''),
(14, 'Koszyk-Order-Complete-main-text', '<p>You have used <a class="underline" href="#">Paypal.com</a><br /> payment for your purchase. Transactions details below&hellip;...</p>', ''),
(15, 'Koszyk-download-main-text', '<p>Below you see tracks which you have bought ready to download. You can download them 3 times, links to them will work 7 days.</p>', ''),
(16, 'ZALOGOWANY-Home-welcome-text', '<p>Welcome in <a class="underline" href="#">Smashintracks.com</a> users panel...</p>', ''),
(17, 'ZALOGOWANY-Home-Twoich-trackow', '<p>Your tracks: <strong>__ILOSC__</strong></p>', '__ILOSC__ - ilość'),
(18, 'ZALOGOWANY-Home-twoich-trackow-w-wishlist', '<p>Your tracks in other users ''Wishlists'': <strong>__ILOSC__</strong></p>', '__ILOSC__ - ilość'),
(19, 'ZALOGOWANY-Home-twoja-wishlist-zawiera', '<p>Your ''Wishlist'' includes tracks:<strong> __ILOSC__</strong></p>', '__ILOSC__ - ilość'),
(20, 'ZALOGOWANY-Home-upload-track', '<p><span>Upload your tracks on <a class="underline" href="#">Smashintracks.com</a> and start makes money!<br /></span></p>', ''),
(21, 'ZALOGOWANY-Home-my-tracks', '<p><span> You can check how often your tracks are previewed, bought and added to others wishlists in this section... </span></p>', ''),
(22, 'ZALOGOWANY-Home-my-downloads', '<p><strong>If you bought any tracks on <a class="underline" href="#">Smashintracks.com</a> you see here full history of your purchases...</strong></p>', ''),
(23, 'ZALOGOWANY-Home-my-wishlist', '<p><strong> You may check your wishlist here. You can keep tracks you wish to buy in future in your profile etc... </strong></p>', ''),
(24, 'ZALOGOWANY-Home-my-profile', '<p><span>Place where you can update your profile on information about yourself, your photos or logo...<br /></span></p>', ''),
(25, 'ZALOGOWANY-My-sales-main-text', '<p>If you are selling any tracks on <a class="underline" href="#">Smashintracks.com</a> you can check your balance, sales and withdraw your money.</p>', ''),
(26, 'ZALOGOWANY-My-sales-Minimalna-kwota-wyplaty', '<p>Balance minimum for withdrawal &nbsp;is<strong></strong> <strong>__KWOTA__</strong></p>', '__KWOTA__ - kwota'),
(27, 'Charts-Last-3-months-main-text', '<p>Here are the list with <span class="blue">30 bestsellers in last 3 months </span>on <a class="underline" href="#">Smashintracks.com</a><br /> See also other ''CHARTS''.</p>', ''),
(28, 'Charts-All-time-main-text', '<p>Here are the list with <span class="blue">30 all time bestsellers </span>on <a class="underline" href="#">Smashintracks.com</a><br /> See also other ''CHARTS''.</p>', ''),
(29, 'Artists-all-main-text', '<p>There is <span class="blue">full listing of all artists</span> <a class="underline" href="#">Smashintracks.com</a> users in this section.</p>', ''),
(30, 'Koszyk-Order-Oczekiwanie-main-text', '<p><strong>Transaction within&hellip;</strong> Wait a while and do not close this page. You will receive links to your purchased tracks shortly.</p>', ''),
(31, 'ZALOGOWANY-Home-Odwiedzin-Twojego', '<p>Your profile views: <strong>__ILOSC__</strong></p>', '__ILOSC__ - ilość'),
(32, 'ZALOGOWANY-Home-my-sales', '<p><strong>If you are selling any tracks on <a class="underline" href="#">Smashintracks.com</a> you can check your balance, sales and withdraw your money.</strong></p>', ''),
(33, 'Zmiana-hasla-main-text', '<p>Please select a clever new password below.</p>', ''),
(34, 'Kontakt-main-text', '<p>If you wish to contact us, use form below. If you have any problems with your purchased tracks do not forget to enter <span class="blue">your order code.</span></p>', ''),
(35, 'Kontakt-message-send', '<p>Your message has been send.</p>', ''),
(36, 'ZALOGOWANY-Wyplata-pieniedzy-zgloszenie-wysla', '<p><strong>Your withdraw aplication has been <span class="blue">sent successfully</span>. Your money will be sent to your Paypal account within <span class="blue">2-3 working days</span>.</strong></p>\r\n<p><strong><br /></strong></p>', ''),
(37, 'ZALOGOWANY-Wyplata-pieniedzy-main-text', '<div class="bw-div1">Your current balance available to spend or withdraw is...</div>\r\n<div id="bw3-div1">Your balance: <strong>__BALANCE__</strong></div>\r\n<div id="bw3-div2">If you would like your money paying to you via <span class="blue">PayPal</span> you will need a minimum ballance of <span class="blue">&pound;10.00</span> first.</div>', '__BALANCE__ - stan konta'),
(38, 'ZALOGOWANY-Wyplata-pieniedzy-spend-it-on', '<p>You can spend what you have earned instantly on <a href="#" class="underline">Smashintracks.com</a><br /><br />\r\n\r\n                        When goto the checkout click <span class="blue">Pay with money earned on <a href="#" class="underline">Smashintracks.com</a></span><br />\r\n                        and what you spend on tunes will be deducted from your earnings.</p>', ''),
(39, 'ZALOGOWANY-Wyplata-pieniedzy-your-paypal', '<p>Click the link bellow and we will send you your earnings on <span class="blue">your PayPal</span> account.</p>', ''),
(40, 'ZALOGOWANY-Wyplata-pieniedzy-sorry', '<p>Sorry but the minimum withrawal limit is <strong><strong>&pound;</strong>10.</strong></p>', ''),
(41, 'ZALOGOWANY-Upload-Track-main-text', '<p>You can upload your tracks here. Limit is <span class="blue">__LIMIT__ </span>tracks per day. Track will be accepted within <span class="blue">24 hours after upload</span> and will be added to the shopping list. Have fun.</p>', '__LIMIT__ - limit'),
(42, 'ZALOGOWANY-Upload-Track-sukces', '<p><strong><span class="blue">Your track has been uploaded successfully.</span></strong></p>\r\n<p>Track will be accepted within 24 hours after upload and will be added to the shopping list. Click <strong>OK</strong> button to close the window.</p>', ''),
(43, 'ZALOGOWANY-Upload-Track-limit', '<p><strong>Unfortunately, you have used your daily upload limit <span class="blue">(__LIMIT__ per day)</span>.&nbsp; Welcome back later.</strong></p>', '__LIMIT__ - limit'),
(44, 'ZALOGOWANY-My-Tracks-All', '<p>You can check how often your tracks are previewed, bought and added to others ''Wishlists'' in this section.</p>', ''),
(45, 'ZALOGOWANY-My-Tracks-Most-Popular', '<p>You can check how often your tracks are previewed, bought and added to others ''Wishlists'' in this section.</p>', ''),
(46, 'ZALOGOWANY-My-Tracks-in-wishlists', '<p>You can check how often your tracks are previewed, bought and added to others ''Wishlists'' in this section.</p>', ''),
(47, 'ZALOGOWANY-My-downloads-main-text', '<p>History of your purchases is here. If you have purchased tracks in last 7 days, you will find links to download them.</p>', ''),
(48, 'ZALOGOWANY-My-Wishlist-last-added', '<p>You may check your wishlist here. You can keep tracks you wish to buy in future in your profile etc.</p>', ''),
(49, 'ZALOGOWANY-My-Wishlist-by-artist', '<p>You may check your wishlist here. You can keep tracks you wish to buy in future in your profile etc.</p>', ''),
(50, 'ZALOGOWANY-My-Profile-main-text', '<p>If you are selling your tracks on SmashinTracks.com it is worth to update your profile on information about yourself, your photos and logos. They will be visible for all your profile visitors.</p>', ''),
(51, 'ZALOGOWANY-My-Profile-main-settings', '<p>You can change here your basic data such as artist name, e-mail, password.</p>\r\n<p><span class="blue"><br /></span></p>', ''),
(52, 'Register-welcome-text', '<div id="bw2-div1">\r\n<p><strong>Congratulations on successful Smashintracks.com registration!</strong></p>\r\n<br />\r\n<p><strong>From now on you will rejoice full functionality of this service, inter alia:</strong></p>\r\n<br /><strong> <span class="blue"> - Uploading and selling your own tracks,<br /><br /> - Buying other tracks with earned money on Smashintracks.com,<br /><br /> - Your own tracks popularity stats managing<br /><br /> &nbsp; and much more.</span></strong></div>\r\n<div><strong><span class="blue"><br /></span></strong></div>\r\n<div id="bw2-div2">\r\n<p><strong>Go to your profile HOMEPAGE to find out your administration panel. Do not forget to update your Profile with photo, informations on your music activity, promo urls etc.</strong></p>\r\n</div>', '');
INSERT INTO `texts_faq` (`texts_faq_id`, `texts_faq_question`, `texts_faq_answer`, `texts_faq_order`) VALUES
(1, 'Can I use tracks available on Smashintracks.com in my sets?', '<p>You are copyrighted to use tracks bought by yourself in mixtapes, radio shows, play in clubs by all means.</p>', 2),
(3, 'Is it possible to take back purchased tracks?', '<p>No, there is no opportunity to take back purchased tracks.</p>', 3),
(10, 'What is the opportunity to buy or sell tracks in wave files?', '<p>There is none. Smashintracks.com allows to buy and sell tracks in mp3 high quality 320 kbps files.</p>', 4),
(11, 'I am a producer and I would like to sell my tracks on Smashintracks.com, what do I have to do?', '<p>You have to only register and upload your tracks using user panel instructions. Tracks will be available within 24 hours.</p>', 5),
(12, 'I am owner of a label and I would like to distribute our tracks with Smashintracks.com - what do I have to do?', '<p>You have to only register and upload your tracks using user panel instructions. Tracks will be available within 24 hours.</p>', 6),
(13, 'Im making music in genre that is not listed in Smashintracks.com, is there any chance to add a new genre?', '<p>Of course, only thing you have to do is to send us email with music genre proposal and add links to your music in order to make it easier for us.</p>', 7),
(14, 'What is the purpose of 10 recommended tracks box on Smashintracks.com?', '<p>You can find here a list with the latest one week selection uploaded by Smashintracks artists. Recommendation is done by Smashintracks.com staff.</p>', 8),
(15, 'Can I pay for my purchases using credit card?', '<p>Payments on Smashintracks.com are made ONLY by Paypal system.</p>', 9),
(16, 'I would like to withdraw money earned here on Smashintracks.com - what do I have to do?', '<p>You have to click WITHDRAW MONEY button in your user panel. Money will be sent to your paypal account within 2 - 3 working days.</p>', 10),
(17, 'I called for money withdraw earned on Smashintracks.com, 3 days has passed by and still don''t have them in my Paypal account, what is happening?', '<p>Please check your paypal address you have put during registration process. Smashintracks.com sends money to paypal address added in registration process. If addresses differs from each other, pleases send us an email with correct Paypal address, Smashintracks.com will send you money once again.</p>', 11);
